CREATE TABLE IF NOT EXISTS "bot_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status" varchar(24) NOT NULL, "created_at" datetime NOT NULL, "accountant_approve_time" datetime NULL, "director_approve_time" datetime NULL, "storekeeper_approve_time" datetime NULL, "user_id" bigint NULL REFERENCES "bot_telegramuser" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_status" varchar(16) NOT NULL, "payment_type" varchar(16) NULL, "agent_id" bigint NULL REFERENCES "bot_telegramuser" ("id") DEFERRABLE INITIALLY DEFERRED, "location_path" varchar(200) NULL, "comment" text NULL, "is_accountant_confirm" bool NOT NULL, "is_director_confirm" bool NOT NULL, "is_storekeeper_confirm" bool NOT NULL);
